import React, {Component} from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import logo from './assets/anshor.space.png';

class Header extends Component{
  render(){
    return(
      <Navbar className="justify-content-between bg-bluegradient white-text" variant="dark">
        <Navbar.Brand>
          <img
            src={logo}
            height="30"
            alt="anshor.space logo"
            />
        </Navbar.Brand>
          <a href="#">ABOUT</a>
      </Navbar>
    );
  }
}

export default Header;
